import { Card, CardMedia } from "@material-ui/core";
import React from "react";
import useStyles from "./styles";

const Post = ({ post }) => {
	const classes = useStyles();
	return (
		<Card className={classes.card}>
			<CardMedia
				className={classes.media}
				image={post.selectedFile}
				title={post.title}
			/>
		</Card>
	);
};

export default Post;
